import React from 'react';
import { Link } from 'react-router-dom';
import { logaut } from '../firebase.js';

const Header = () => {
    return (
        <header className='bg-white border-b border-gray-300'>
            <div className='flex item-center justify-between h-[60px]'>
                <Link to="/">
                    <div className='bg-logo-instagram h-[29px] bg-[0px_0px]  bg-[length:176px_181px] bg-no-repeat' />
                </Link>

                <nav>
                    <button onClick={logaut}>logaut</button>
                </nav>
            </div>

        </header>
    );
};

export default Header;
